#include <vector>
#include <algorithm>

using namespace std;

class Solution {
public:
    vector<int> goodSubsetofBinaryMatrix(vector<vector<int>>& grid) {
        int m = grid.size(), n = grid[0].size();
        vector<int> bestSubset;

        for (int subset = 1; subset < (1 << m); ++subset) {
            bool good = true;
            for (int col = 0; col < n && good; ++col) {
                int sum = 0;
                for (int row = 0; row < m; ++row) {
                    if (subset & (1 << row)) {
                        sum += grid[row][col];
                    }
                }
                if (sum > __builtin_popcount(subset) / 2) {
                    good = false;
                }
            }
            if (good) {
                if (bestSubset.empty() || __builtin_popcount(subset) > __builtin_popcount(*reinterpret_cast<unsigned int*>(&bestSubset))) {
                    bestSubset.clear();
                    for (int row = 0; row < m; ++row) {
                        if (subset & (1 << row)) {
                            bestSubset.push_back(row);
                        }
                    }
                }
            }
        }

        return bestSubset;
    }
};
